import {Component} from 'react'

class Header extends Component{

    fun = ()=> {
        fetch('sample.txt')
        .then((response)=>{
            console.log(response.text())
        })   
    }
    render(){
        return(
            <div>
                <p>hello world</p>
                <button onClick={this.fun}>click</button>
            </div>
        )
    }
}
export default Header
